import React from "react";

function GuestDashboardAsk() {
  return (
    <div className="grid place-items-center w-full h-full bg-black/75 ">
      <div className="max-w-[30rem] w-full flex flex-col items-center justify-center py-14 px-4">
        {/* 
            ///////////Thanks Title////////
            ////////////////////////// */}
        <p className="text-white text-3xl text-center leading-10 font-normal ">
          <span className="block">THANK YOU</span> FOR PARTICIPATING IN
          <span className="block"> PROJECT KARMA</span>
        </p>
        {/* 
            ///////////Pargraph////////
            ////////////////////////// */}
        <p className="text-center text-white text-sm font-family mt-3">
          Your feedback is helping to shape the future of
          <span className="block mb-3"> cannabis in Canada.</span>
          <span className="block">
            Creating a Profile on Project Karma allows you to track and
            catalogue strains and skus as you sample them. The platform is a
            place to log tasting notes on new strains and SKUS and to let us
            know how they stack up against other products
          </span>
          <span className="block mb-3"> on the market </span>
          <span className="block mb-3">
            With the Journal feature you can recall your experiences from past
            sessions and also search our database of experiences posted by other
            budtenders and industry insiders like yourself.
          </span>
          <span className="block mb-3">
            From time to time, Project Karma participants are invited to weigh
            in on unreleased and exclusive strains before they head to market.
            Put that in your pipe and smoke it!
          </span>
          There are no charges, hooks or gimmicks to participate in Project
          Karma. Just high vibes.
        </p>
        {/* 
            ///////////Buttons////////
            ////////////////////////// */}
        <div>
          <button className="w-full py-2.5 bg-[#A7AE45] rounded-lg text-xl font-family text-white font-bold mt-5">
            Sure, set me up!
          </button>{" "}
          <button className="w-full py-2.5 bg-[#A7AE45] rounded-lg text-xl font-family text-white font-bold mt-5">
            Nah, continue as Guest
          </button>
        </div>
        {/* <button className="w-[292px] h-[41.5px] bg-[#A7AE45] rounded-[10px] text-xl font-family text-white font-bold mt-3">

        </button> */}
      </div>
    </div>
  );
}

export default GuestDashboardAsk;
